    true,nt"url": null,nt"notes": "<p>1993 - 2010. Centers for Disease Control
    and Prevention (CDC). Data are from the Behavioral Risk Factor Surveillance System
    (BRFSS). All respondents to the BRFSS are non-institutionalized adults, 18 years
    old or older. HRQOL surveillance is used to identify unmet population health needs
    including recognizing trends, disparities, and determinants of health in the population.
    HRQOL surveillance data can be used to inform decision making, and program and policy
    development. To assure that the population is benefiting from public health programs,
    HRQOL surveillance data can be used for program evaluation. A compact set of HRQOL
    measures including a summary measure of unhealthy days have been developed and validated
    for population health surveillance and have been widely used since 1993.</p>n",nt"license_title":
